import React from "react"
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Container from "react-bootstrap/Container"


function App() {
  return (
    <Container>
    <Stack direction="horizontal" gap="2" className="mb-4">
      <h1 className="me-auto"></h1>
    </Stack>
    </Container>
  );
}

export default App;
